def cups_features(machine, field_prefix):
    res = []
    res += enumerated_field(machine, '{}_cups_version'.format(field_prefix),
                            cups_versions,
                            add_fields=['{}_attr_cups_version'.format(field_prefix)],
                            version=True)
    return res


def meta_features(machine, field_prefix):
    res = []
    res += enumerated_field(machine, '{}_version_string'.format(field_prefix), versions,
                            add_fields=['{}_attr_ipp_versions'.format(field_prefix)],
                            version=True)
    res += [
        Feature(as_obj={
            '_id': '{}_SUPPORTED'.format(field_prefix),
            '_type': 'MACHINE',
            'expansion_safe': True,
            'value': get_field(machine, '{}_supported'.format(field_prefix)),
            'description': 'is {} supported?'.format(field_prefix)
        })
    ]

    return res


def extract(machine, args):
    res = []
    protocol = 'ipp'
    ports = [p for c in ports_and_protocols
             if c[0] == protocol
             for p in c[1]]
    for port in sorted(ports, reverse=True):
        field_prefix = 'p{}_{}_banner'.format(port, protocol)
        res += cups_features(machine, field_prefix)
        res += meta_features(machine, field_prefix)
        res += tls_f.extract(machine,
                             args=args,
                             field=field_prefix,
                             _id='P{}_{}'.format(port, protocol))
    return res


